ense. '=>'Введен неверный лицензионный ключ; пожалуйста, посетите сайт %1$sGravity Forms%2$s для проверки данных лицензии. ','Renews On'=>'Обновляется','Expires On'=>'Истекает','Expired On'=>'Истекает','Upgrade'=>'Обновить','Manage'=>'Управлять','Sites Exceeded'=>'Сайтов превышено','Expired'=>'Истёк','Invalid'=>'Недействительный','by'=>'от','Dismiss notification'=>'Отклонить уведомление','Save Form'=>'Сохранить форму','Select date'=>'Выбрать дату','Sorry, this file type is not permitted for security reasons.'=>'Извините, этот тип файла не разрешён из соображений безопасности.','Sorry, this file extension is not permitted for security reasons.'=>'Извините, это расширение файла не разрешено из соображений безопасности.','There was an problem while verifying your file.'=>'При проверке вашего файла возникла проблема.','Full Name'=>'Полное имя','Full Address'=>'Полный адрес','If you currently have a support ticket open, please do not disable logging until the Support Team has reviewed your logs. '=>'Если в настоящее время у вас открыта заявка в службу поддержки, не отключайте ведение журнала до тех пор, пока служба поддержки не просмотрит ваши журналы.','Adding conditional logic to the form submit button could cause usability problems for some users and negatively impact the accessibility of your form. Learn more about button conditional logic in our %1$sdocumentation%2$s.'=>'Добавление условной логики в кнопку отправки формы может вызвать проблемы с удобством использования для некоторых пользователей и негативно повлиять на доступность вашей формы. Узнайте больше об условной логике кнопки в нашей %1$sдокументации%2$s.','User (ID: %d) Locale'=>'Локаль пользователя (ID: %d)','Site Locale'=>'Локаль сайта','Translations'=>'Переводы','Once troubleshooting is complete, %1$sclick here to disable logging and permanently delete your log files.%2$s '=>'Как только вопрос решится, %1$sнажмите здесь для отключения журналирования и удаления файлов журнала.%2$s ','Since logs may conta