our form to help organize groups of fields. This is a visual element and does not collect any data.'=>'Добавляет разделитеть содержимого в вашу форму, чтобы помочь организовать группы полей. Это визуальный элемент, он не собирает никакие данные.','Allows users to enter a physical address.'=>'Позволяет пользователям вводить физический адрес.','Allows users to enter their name in the format you have specified.'=>'Позволяет пользователям вводить их имя в заданном вами формате.','Allows users to select multiple options available in the multi select box.'=>'Позволяет пользователям выбирать несколько вариантов, доступных в поле множественного выбора.','Allows users to enter a date.'=>'Позволяет пользователям вводить дату.','Allows users to submit a time as hours and minutes.'=>'Позволяет пользователям указывать время в часах и минутах.','Allows users to submit data that is then used as the excerpt of a post.'=>'Позволяет пользователям отправлять данные, которые будут использоваться в качестве выдержки из записи.','Allows the user to enter a password and confirm it.  The password will be masked with blobs or asterisks.'=>'Позволяет пользователю ввести пароль и подтвердить его. Пароль будет замаскирован каплями или звездочками.','Allows users to submit data that is used as a custom field value for a post.'=>'Позволяет пользователям отправлять данные, которые используются в качестве значения пользовательского поля для записи.','Allows users to enter a number.'=>'Позволяет пользователям вводить номер.','Allows users to submit the title for a post.'=>'Позволяет пользователям отправлять названия к записям.','Allows the creation of products in the form.'=>'Позволяет создавать товары в форме.','Allows the user to select a category for the post they are creating.'=>'Позволяет пользователям выбирать категорию для записи, которую они создают.','Allows users to enter credit card information.'=>'Позволяет пользователям вводить информацию о кредитных картах.','Allows users to enter a website URL.'=>'Позволяет пользователям вводить URL веб-сайта.','Allows users to enter a phone number.'=>'Позволяет пользователям вводить номер телефона.','Stores information that should not be visible to the user but can be processed and saved with the user submission.'=>'Хранит информацию, которую пользователь не должен видеть, но она может быть обработана и сохранена при отправке пользователем.','Allows a quantity to be specified for product field.'=>'Позволяет указать количество в поле товаров.','Allows users to select one or many checkboxes.'=>'Позволяет пользователям устанавливать один или нескольно флажков.','This field has errors.'=>'Это поле содержит ошибки.','An empty label violates %1$sWCAG%2$s. Please use descriptive text for your label. To hide the label, use the "Field Label Visibility" setting.'=>'Пустая метка нарушает %1$sWCAG%2$s. Пожалуйста, используйте описательный текст для метки. Чтобы скрыть метку, используйте настройки "Видимость метки поля".','To better comply with %1$sWCAG%2$s, we use the placeholder or description as a hidden label for screen readers.'=>'Для лучшего соответствия с %1$sWCAG%2$s мы используем заполнитель или описание в качестве скрытой метки для читателей экрана.','Minute'=>'Минута','Hour'=>'Час','MM'=>'MM','This operation deletes ALL Gravity Forms settings. If you continue, you will NOT be able to retrieve these settings.'=>'Эта операция удалит ВСЕ настройки Gravity Forms. Если вы продолжите, вы не сможете восстановить их.','{0} of the following match:'=>'{0} из следующих значений:','Disable'=>'Отключить','Provide a title and a description for this form'=>'Укажите название и описание к этой форме','Resend'=>'Отправить заново','Print entry'=>'Распечатать запись','Please review the fields below.'=>'Пожалуйста, просмотрите поля ниже.','End date'=>'Дата завершения','Start date'=>'Дата начала','Include results if'=>'Включать результаты, если','You must have at least one form to use the block.'=>'Для использования блока необходимо 