ть интеграцию Akismet','Enable to prevent extraneous scripts and styles from being printed on a Gravity Forms admin pages, reducing conflicts with other plugins and themes.'=>'Включите для предотвращения загрузки лишних скриптов и стилей на страницах администрирования Gravity Forms, чтобы уменьшить конфликты с другими плагинами и темами.','No Conflict Mode'=>'Бесконфликтный режим','Enable Automatic Background Updates'=>'Включить автоматические фоновые обновления','Enable to allow Gravity Forms to download and install bug fixes and security updates automatically in the background. Requires a valid license key.'=>'Включить, чтобы разрешить Gravity Forms автоматически загружать и устанавливать исправления ошибок и обновления безопасности в фоновом режиме. Для этого нужен действительный лицензионный ключ.','Automatic Background Updates'=>'Автоматические фоновые обновления','Enable Toolbar Menu'=>'Включить меню панели инструментов','Enable to display the forms menu in the WordPress top toolbar. The forms menu will display the ten forms recently opened in the form editor.'=>'Включить, чтобы отображать меню форм в верхней панели инструментов WordPress. Меню форм будет отображать десять последних форм, открытых в редакторе форм.','Enable Logging'=>'Включить журналирование','Enable if you would like logging within Gravity Forms. Logging allows you to easily debug the inner workings of Gravity Forms to solve any possible issues. '=>'Включите для журналирования Gravity Forms. Ведение журнала позволяет легко отлаживать внутреннюю работу Gravity Forms для решения любых возможных проблем.','Logging'=>'Журналирование','Select the default currency for your forms. This is used for product fields, credit card fields and others.'=>'Выберите для форм валюту по умолчанию. Это значение используется для полей товаров, кредитных карт и др.','Default Currency'=>'Валюта по умолчанию','Disable CSS'=>'Отключить CSS','Output Default CSS'=>'Выводить CSS по умолчанию','Paste Your License Key Here'=>'Вставьте сюда свой лицензионный ключ','A valid license key is required for access to automatic plugin upgrades and product support.'=>'Для доступа к автоматическим обновлениям плагина и техподдержке требуется действующий лицензионный ключ.','Support License Key'=>'Лицензионный ключ','Your license key has been successfully validated. '=>'Лицензионный ключ был успешно проверен. ','Warning! ALL Gravity Forms data, including form entries will be deleted. This cannot be undone. \'OK\' to delete, \'Cancel\' to stop'=>'Внимание! ВСЕ данные Gravity Forms, включая записи форм, будут удалены. Это необратимо.  \'OK\' — удалить, \'Отмена\' — отменить действие','Gravity Forms has been successfully uninstalled. It can be re-activated from the %splugins page%s.'=>'Gravity Forms  успешно удален. Плагин может быть повторно активирован на %sстранице плагинов%s.','You don\'t have adequate permission to uninstall Gravity Forms.'=>'У вас недостаточно прав для удаления Gravity Forms.','Select the visibility for this field.'=>'Выберите видимость для этого поля.','The field is only visible when administering submitted entries. The field is not visible or functional when viewing the form.'=>'Это поле видимо только во время управления записями формы. Поле скрыто и не работает во время просмотра формы.','Administrative'=>'Административное','The field is hidden when viewing the form. Useful when you require the functionality of this field but do not want the user to be able to see this field.'=>'Во время просмотра формы это поле скрыто. Это удобно, когда вам необходима функциональность этого поля, но вы хотите скрыть его от пользователя.','Default option. The field is visible when viewing the form.'=>'Значение по-умолчанию. Это поле видимо при просмотре формы.','Visible'=>'Видимое','Cancel this upload'=>'Отменить эту загрузку','Please wait for the uploading to complete'=>'Пожалуйста, дождитесь окончания загрузки','There was a problem while saving the file on the server'=>'Возникла проблема при сохранении файла на сервере','Maximum number of files reached'=>'Достигнуто максимальное количество файлов','This type of file is not allowed.'=>'Этот тип файла запрещен.','File exceeds size limit'=>'Файл превышает ограничение по размеру','in progress'=>'в процессе','Delete this file'=>'Удалить этот файл','This type of file is not allowed. Must be one of the following: '=>'Этот тип файла запрещен. Должен быть одним из следующих:','Voided'=>'Аннулировано','Refunded'=>'Возвращено','Cancelled'=>'Отменено','Failed'=>'Неудача','Processing'=>'В обработке','Paid'=>'Оплачен','Authorized'=>'Авторизован','Transaction ID'=>'ID транзакции','Source URL'=>'Url источника','Starred'=>'Избранные','Any form field'=>'Любое поле формы','Predefined Choices'=>'Предопределенные варианты','Custom Choices'=>'Произвольные варианты','Remove a condition'=>'Удалить условие','Add a condition'=>'Добавить условие','Deleting this field will also delete all entry data associated with it. \'Cancel\' to abort. \'OK\' to delete.'=>'Удаление этого поля приведет к удалению всех связанных с ним данных. \'Отмена\' - чтобы отменить действие, \'OK\' - чтобы продолжить.','Please enter a confirmation name.'=>'Пожалуйста, введите имя для подтверждения.','Please enter a URL.'=>'Пожалуйста, введите URL.','Please select a page.'=>'Пожалуйста, выберите страницу.','Untitled Confirmation'=>'Подтверждение без названия','There are unsaved changes to the current confirmation. Would you like to discard these changes?'=>'Текущее подтверждение имеет не сохраненные изменения. Вы хотите отменить эти изменения?','Are you sure you wish to delete this confirmation?'=>'Вы уверены, что хотите удалить это подтверждение?','There was an issue saving this confirmation.'=>'Ошибка при сохранении этого подтверждения.','Are you sure you wish to cancel these changes?'=>'Вы действительно хотите отменить все изменения?','Saving...'=>'Сохранение...','Send this notification if'=>'Послать это уведомление, если','Use this confirmation if'=>'Использовать это подтверждение, если','Empty (no choices selected)'=>'Пусто (ничего не выбрано)','of the following match:'=>'из следующих значений:','Conditional LogicAny'=>'Любое','Conditional LogicAll'=>'Все','Hide'=>'Скрыть','Show'=>'Показать','this form button if'=>'эту кнопку формы, если','this section if'=>'эта секция, если','this field if'=>'это поле, если','We would love to hear from you! Please fill out this form and we will get in touch with you shortly.'=>'Мы хотели бы услышать вас! Пожалуйста, заполните эту форму — и мы свяжемся с вами в ближайшее время.','Untitled Form'=>'Без названия','Enter a value'=>'Введите значение','5 of %d items shown. Edit field to view all'=>'5 из %d элементов показано. Измените поле, чтобы увидеть все','Select a format'=>'Выберите формат','The form has been saved.  The content contains the link to return and complete the form.'=>'Форма сохранена. В содержании находится ссылка на возврат и заполнение формы.','Row removed'=>'Строка удалена','New row added.'=>'Новая строка добавлена.','Pricing fields are not editable'=>'Расценочные поля не редактируются','%1$s at %2$s'=>'%1$s в %2$s','%s ago'=>'%s назад','Gravity Forms requires WordPress %s or greater. You must upgrade WordPress in order to use Gravity Forms'=>'Gravity Forms требует WordPress версии %s или выше. Вы должны обновить WordPress, чтобы использовать Gravity Forms.','Cannot send email because the FROM address is invalid.'=>'Невозможно отправить письмо, потому что адрес FROM неверен.','Cannot send email because there is no SUBJECT and no MESSAGE.'=>'Невозможно отправить письмо, потому что отсутствует ТЕМА и ТЕКСТ письма.','Cannot send email because the TO address is invalid.'=>'Невозможно отправить письмо, потому что адрес TO неверен.','Allowable form fields'=>'Доступные поля формы','Full Size - Right Aligned'=>'Полный размер - выравнивание по правому краю','Full Size - Centered'=>'Полный размер - выравнивание по центру','Full Size - Left Aligned'=>'Полный размер - выравнивание по левому краю','Full Size'=>'Полный размер','Large - Right Aligned'=>'Большой - выравнивание по правому краю','Large - Centered'=>'Большое - выравнивание по центру','Large - Left Aligned'=>'Большой - выравнивание по левому краю','Medium - Right Aligned'=>'Средний - выравнивание по правому краю','Medium - Centered'=>'Средний - выравнивание по центру','Medium - Left Aligned'=>'Средний - выравнивание по левому краю','Thumbnail - Right Aligned'=>'Миниатюра - выравнивание по правому краю','Thumbnail - Centered'=>'Миниатюра - выравнивание по центру','Thumbnail - Left Aligned'=>'Миниатюра - выравнивание по левому краю','Thumbnail'=>'Миниатюра','Select image size'=>'Выберите размер изображения','Pricing form fields'=>'Расценочные поля формы','Optional form fields'=>'Необязательные поля формы','Required form fields'=>'Обязательные поля формы','Post Edit URL'=>'URL редактирования записи','Form Id'=>'Id формы','Entry URL'=>'URL записи','All Pricing Fields'=>'Все расценочные поля','All Submitted Fields'=>'Все отправленные поля','Forms per page:'=>'Форм на странице:','Select an action for this shortcode. Actions are added by some add-ons.'=>'Выбрать действие для этого сокращенного кода. Действия добавляются некоторыми дополнениями.','Select an action'=>'Выбрать действие','Specify the starting tab index for the fields of this form.'=>'Укажите индекс начальной вкладки для полей этой формы.','Specify whether or not to use Ajax to submit the form.'=>'Укажите использовать ли Ajax для отправки формы.','Whether or not to display the form description.'=>'Отображать ли описание формы.','Whether or not to display the form title.'=>'Отображать ли заголовок формы.','Can\'t find your form? Make sure it is active.'=>'Не можете найти форму? Убедитесь, что она активна.','Select a form from the list to add it to your post or page.'=>'Выберите форму из списка, чтобы добавить ее к вашей записи блога или странице.','Select a form below to add it to your post or page.'=>'Выберите форму ниже, чтобы добавить ее в вашу запись блога или страницу.','All Forms'=>'Все формы','Recent'=>'Недавние','Preview this form'=>'Предварительный просморт этой формы','Editor'=>'Редактор','Oops! There was an error saving the form title. Please refresh the page and try again.'=>'Ой! Возникла ошибка при сохранении заголовка формы. Пожалуйста, обновите страницу и попробуйте снова.','The %sSend To%s email address provided is not valid.'=>'Предоставленный адрес электронной почты %sОтправить На%s неверен.','No notifications have been selected. Please select a notification to be sent.'=>'Не выбрано ни одного уведомления. Пожалуйста, выберите уведомление для отправки.','There was an error while resending the notifications.'=>'Произошла ошибка при повторной отправке уведомлений.','Add-On browser is currently unavailable. Please try again later.'=>'Браузер дополнений в данный момент не доступен. Попробуйте позже.','Finished'=>'Завершено','Unable to disable logging.'=>'Невозможно отключить журналирование.','Logging disabled.'=>'Журналировавние отключено.','Failed to load the preview for this form.'=>'Не удалось загрузить предварительный просмотр для этой формы.','Please select a form.'=>'Пожалуйста, выберите форму.','Dismiss'=>'Отклонить','There is an update available for Gravity Forms. %sView Details%s'=>'Обновление доступно для Gravity Forms. %sПосмотреть подробности%s','You don\'t have any forms. Let\'s go %screate one %s!'=>'У вас нет ни одной формы. Давайте %sсоздадим первую%s!','View All Forms'=>'Посмотреть все формы','View All Entries'=>'Посмотреть все записи','Last Entry: %s'=>'Последняя запись: %s','Unread'=>'Непрочитано','Oops!! Something went wrong. %sPlease try again or %scontact us%s.'=>'Ой!! Что-то пошло не так. %sПожалуйста, попробуйте еще раз или %sсвяжитесь с нами%s.','The versions of the following add-ons you\'re running haven\'t been tested with Gravity Forms %s. Please update them or confirm compatibility before updating Gravity Forms, or you may experience issues:'=>'Версии этих активных дополнений не тестировались на совместимость с Gravity Forms %s. Пожалуйста, обновите дополнения либо подтвердите совместимость перед обновлением Gravity Forms. Иначе возможны такие осложнения:','IMPORTANT: As this is a major update, we strongly recommend creating a backup of your site before updating.'=>'ВНИМАНИЕ! Поскольку это серьезное обновление, мы рекомендуем сделать резервную копию вашего сайта перед обновлением.','%1$sRegister%2$s your copy of Gravity Forms to receive access to automatic upgrades and support. Need a license key? %3$sPurchase one now%4$s. '=>'%1$sЗарегистрируйте%2$s вашу копию Gravity Forms, чтобы получить доступ к автоматическим обновлениям и технической поддержке. Нужен лицензионный ключ? %3$sПриобретите его прямо сейчас%4$s. ','<a href="%1$s" class="update-link" aria-label="Update %2$s now">'=>'<a href="%1$s" class="update-link" aria-label="Обновить %2$s сейчас">','There is a new version of %1$s available. %2$sView version %3$s details%4$s or %5$supdate now%6$s. '=>'Доступна свежая версия %1$s. %2$sПосмотреть детали версии %3$s s%4$s или %5$sобновиться прямо сейчас%6$s.','<a class="thickbox open-plugin-details-modal" aria-label="View %1$s version %2$s details" href="%3$s">'=>'<a class="thickbox open-plugin-details-modal" aria-label="Просмотреть детали версии %2$s плагина %1$s" href="%3$s">','There is a new version of %1$s available. %2$sView version %3$s details%4$s. '=>'Доступна свежая версия %1$s. %2$sПосмотреть детали версии %3$s %4$s.','This version of the %1$s is not compatible with the version of Gravity Forms that is installed. Upgrade this add-on to version %2$s or greater to avoid compatibility issues and potential loss of data.'=>'Версия %1$s несовместима с установленной версией Gravity Forms. Обновите это дополнение до версии %2$s или выше, чтобы избежать несовместимости и потенциальной потери данных.','Please select a form'=>'Выберите форму','Add Form'=>'Добавить форму','Add Gravity Form'=>'Создать форму','New Form'=>'Новая форма','Update Available'=>'Доступно обновление','Upload folder is not writable. Export and file upload features will not be functional.'=>'Папка загрузки недоступна для записи. Функции экспорта и загрузки не будут работать.','REST API Settings'=>'Настройки REST API','Logging Settings'=>'Настройки журналирования','Uninstall Gravity Forms'=>'Удалить Gravity Forms','View System Status'=>'Просмотр статуса системы','Manage Add-Ons'=>'Управление дополнениями','Manage Updates'=>'Управление обновлениями','Edit Plugin Settings'=>'Редактировать настройки плагина','View Plugin Settings'=>'Просмотр натроек плагина','Edit Entry Notes'=>'Редактировать запись','View Entry Notes'=>'Просмотреть запись','Delete Entries'=>'Удалить записи','Edit Entries'=>'Редактировать записи','View Entries'=>'Посмотреть записи','Preview Forms'=>'Предпросмотр форм','Edit Forms'=>'Редактировать формы','Delete Forms'=>'Удалить формы','Create Forms'=>'Создать формы','Check this box to add a toggle allowing the user to see the password they are entering in.'=>'Отметьте параметр, чтобы добавить переключатель видимости пароля, вводимого пользователем.','Password Visibility Toggle'=>'Переключение видимости пароля','Use these settings to keep entries only as long as they are needed. Trash or delete entries automatically older than the specified number of days. The minimum number of days allowed is one. This is to ensure that all entry processing is complete before deleting/trashing. The number of days setting is a minimum, not an exact period of time. The trashing/deleting occurs during the daily cron task so some entries may appear to remain up to a day longer than expected.'=>'Используйте эти настройки, чтобы хранить записи определенное время. Перемещайте в корзину или удаляйте записи по истечении определенного количества дней. Минимальное разрешенное количество дней равно одному, чтобы убедиться, что вся обработка записей окончена перед удалением. Количество дней следует воспринимать как минимум, а не как точный период времени. Удаление и перемещение в корзину происходит ежедневно по расписанию, потому некоторые записи могут быть нетронутыми на день больше, чем ожидалось.','Check this box if you would like to prevent the IP address from being stored during form submission.'=>'Отметьте этот флажок, чтобы предотвратить запись адреса IP при отправке формы.','Select the fields which will be included when exporting or erasing personal data.'=>'Выберите поля, которые следует включить в процесс экспорта или удаления персональных данных.','Select the field which will be used to identify the owner of the personal data.'=>'Выберите, какое из полей будет использовано для идентификации владельца персональных данных.','Identification'=>'Идентификация','Check this box if you would like to include data from this form when exporting or erasing personal data on this site.'=>'Отметьте этот флажок, если хотите включить данные формы при экспорте или удалении персональных данных на сайте.','Enable Personal Data Tools'=>'Включить инструменты персональных данных','Check this box if you would like to use the rich text editor for this field.'=>'Отметьте этот флажок, если хотите использовать расширенный текстовый редактор для этого поля.','Use Rich Text Editor'=>'Использовать расширенный текстовый редактор','Enter text to display at the top of the progress bar.'=>'Введите текст для отображения сверху индикатора выполнения.','Progress Bar Completion Text'=>'Текст завершения индикатора выполнения','Check this box if you would like the progress bar to display with the confirmation text.'=>'Отметьте этот флажок, если хотите отображать индикатор выполнения вместе с текстом подтверждения.','Progress Bar Confirmation Display'=>'Отображение подтверждения индикатора выполнения','Enter a comma separated list of email addresses you would like to receive the selected notification emails.'=>'Введите список адресов электронной почты, разделенный запятыми, на который следует высылать письма с выбранными  уведомлениями.','Override Notifications'=>'Переопределение уведомлений','Tab Index Start Value'=>'Начальное значение индекса вкладки','Conversion is the percentage of form views that generated an entry. If a form was viewed twice, and one entry was generated, the conversion will be 50%.'=>'Конверсия это процент просмотра форм, при котором генерируется запись, т.е. эта форма отправляется пользователями. Если форма просмотрена дважды, и один раз отправлена, конверсия будет составлять 50%.','Entries Conversion'=>'Конверсия записей','Please select the currency for your location.  Currency is used for pricing fields and price calculations.'=>'Введите валюту для вашего региона. Валюта используется в расценочных полях и для калькуляции стоимости.','Select the type of reCAPTCHA you would like to use.'=>'Выберите тип reCAPTCHA, который хотите использовать.','reCAPTCHA Type'=>'Тип reCAPTCHA','Enter your reCAPTCHA Secret Key, if you do not have a key you can register for one at the provided link.  reCAPTCHA is a free service.'=>'Введите ваш секретный ключ reCAPTCHA. Если у вас нет ключа, вы можете зарегистрировать его по предоставленной ссылке. reCAPTCHA является бесплатным сервисом.','reCAPTCHA Secret Key'=>'Секретный ключ reCAPTCHA','Enter your reCAPTCHA Site Key, if you do not have a key you can register for one at the provided link.  reCAPTCHA is a free service.'=>'Введите ваш ключ сайта reCAPTCHA. Если у вас нет ключа, вы можете зарегистрировать его по предоставленной ссылке. reCAPTCHA является бесплатным сервисом.','reCAPTCHA Site Key'=>'Ключ сайта reCAPTCHA','Select On or Off to enable or disable no-conflict mode. Setting this to On will prevent extraneous scripts and styles from being printed on Gravity Forms admin pages, reducing conflicts with other plugins and themes.'=>'Выберите Вкл или Откл для включения или отключения бесконфликтного режима. Установка этого параметра будет препятствовать тому, что бы посторонние скрипты и стили включались на страницах консоли Gravity Forms, тем самым уменьшая конфликты с другими плагинами и темами.','Select yes or no to enable or disable HTML5 output. Setting this to no will disable the standard Gravity Forms HTML5 form field output.'=>'Выберите да или нет для включения или выключения вывода HTML5. Если установить \\"нет\\", то в выводе полей Gravity Forms HTML5 будет отключен.','Select yes or no to enable or disable CSS output.  Setting this to no will disable the standard Gravity Forms CSS from being included in your theme.'=>'Выберите да или нет для включения или отключения вывода CSS. Выбрав нет, стили Gravity Forms будут браться из таблицы стилей вашей темы.','Your Gravity Forms support license key is used to verify your support package, enable automatic updates and receive support.'=>'Лицензионный ключ Gravity Forms служит для идентификации вашего вида лицензии, включения автоматического обновления и получения поддержки.','Settings License Key'=>'Настройка лицензионного ключа','Select a date range. Setting a range will limit the export to entries submitted during that date range. If no range is set, all entries will be exported.'=>'Выберите отрезок даты. Установка отрезка ограничит экспорт лишь теми записями, что добавлены в этот период. Если отрезок не задан, будут экспортированы все записи.','Export Date Range'=>'Диапазон дат для экспорта','Select the fields you would like to include in the export.'=>'Выберите поля, которые вы хотите включить в экспорт.','Export Selected Fields'=>'Экспорт выбранных полей','Filter the entries by adding conditions.'=>'Отфильтруйте записи, добавив условия.','Select the forms you would like to export.'=>'Выберите формы, которые вы хотите экспортировать.','Export Selected Forms'=>'Экспорт выбранных форм','Select the form you would like to export entry data from. You may only export data from one form at a time.'=>'Выберите форму, данные из которой вы хотите экспортировать. Вы можете одновременно экспортировать данные только из одной формы.','Export Selected Form'=>'Экспорт выбранной формы','Pricing fields allow you to add fields to your form that calculate pricing for selling goods and services.'=>'Расценочные поля позволяют добавить в форму поля, служащие для калькуляции стоимости при продаже товаров и услуг.','Post Fields allow you to add fields to your form that create Post Drafts in WordPress from the submitted data.'=>'Поля записей позволяют добавить в форму поля, которые служат для создания черновиков записей из отправленных данных.','Advanced Fields are for specific uses.  They enable advanced formatting of regularly used fields such as Name, Email, Address, etc.'=>'Расширенные поля нужны для конкретных целей. Они позволяют расширить возможности форматирования, используя такие поля как Имя, Email, Адрес и т.д.','Standard Fields provide basic form functionality.'=>'Стандартные поля служат для обеспечения базовой функциональности форм.','Input masks provide a visual guide allowing users to more easily enter data in a specific format such as dates and phone numbers.'=>'Маски ввода — визуальный путеводитель, помогающий пользователям вводить данные в строго определенном формате, например даты и номера телефонов.','Select which Product this field is tied to.'=>'Выберите с каким продуктом связано это поле.','Product Field'=>'Поле продукта','Disables the quantity field.  A quantity of 1 will be assumed or you can add a Quantity field to your form from the Pricing Fields.'=>'Отключает поле количества. Будет предполагаться количество равное 1, или вы можете добавить поле Количество на форму из расценочных полей.','Disable Quantity'=>'Отключить количество','Enter the base price for this product.'=>'Введите базовую стоимость этого товара','Base Price'=>'Базовая стоимость','Enter the content (Text or HTML) to be displayed on the form.'=>'Введите содержание (Tекст или HTML), которое будет показываться в форме.','Check this option to enable data to be passed to the form and pre-populate this field dynamically. Data can be passed via Query Strings, Shortcode and/or Hooks.'=>'Отметьте эту опцию, чтобы позволить передачу данных форме и предварительное заполнение этого поля динамически. Данные могут передаваться через строку запроса, короткий код и/или хуки.','Incoming Field Data'=>'Входящие данные поля','Check this option to set this image as the post\'s Featured Image.'=>'Отметьте эту опцию, чтобы использовать это изображение как избранное для записи.','Select one or more image metadata field to be displayed along with the image upload field. They enable users to enter additional information about the uploaded image.'=>'Выберите одно или более полей для отображения метаданных изображения рядом с полем загрузки изображения. Это позволит пользователям ввести дополнительную информацию для загруженного изображения.','Image Meta'=>'Метаданные изображения','Selecting this option will set the post author to the WordPress user that submitted the form.'=>'При выборе этого параметра автором записи будет пользователь WordPress, который отправил форму.','Use Current User as Author'=>'Использовать текущего пользователя как автора','Select the category that will be used for the post that is created by the form entry.'=>'Выберите рубрику, которая будет использоваться для записи, созданной с помощью этой формы.','Check this option to format and insert merge tags into the Post Title.'=>'Отметьте эту опцию, чтобы отформатировать и вставить метку слияния в заголовок записи.','Post Title Template'=>'Шаблон заголовка записи','Check this option to format and insert merge tags into the Post Content.'=>'Отметьте эту опцию, чтобы отформатировать и вставить метку слияния в содержимое записи.','Post Content Template'=>'Шаблон содержимого записи','Select the post format that will be used for the post that is created by the form entry.'=>'Выберите формат записи, который будет использоваться для записи, созданной этой формой.','Select the author that will be used for the post that is created by the form entry.'=>'Выберите автора новой записи блога, созданной этой формой.','Post Author'=>'Автор записи','Select the post status that will be used for the post that is created by the form entry.'=>'Выберите статус записи блога, который будет использоваться для записи, созданной этой формой.','Select which categories are displayed. You can choose to display all of them or select individual ones.'=>'Выберите какие из рубрик будут отображены. Вы можете выбрать отображение всех или только некоторых из них.','Create rules to dynamically display or hide the submit button based on values from another field.'=>'Создайте правила для динамического отображения или сокрытия кнопки Отправить на основе значений из другого поля.','Create rules to dynamically display or hide the page\'s Next Button based on values from another field.'=>'Создайте правила для динамического отображения или сокрытия кнопки следующей страницы на основе значений из другого поля.','Next Button Conditional Logic'=>'Условная логика кнопки Далее','Enter the path to an image you would like to use as the page previous button.'=>'Введите путь к изображению, которое вы хотите использовать в качестве кнопки для предыдущей страницы.','Previous Button Image'=>'Изображение кнопки Назад','Enter the text you would like to appear on the page previous button.'=>'Введите текст, который вы бы хотели видеть на кнопке для предыдущей страницы.','Previous Button Text'=>'Текст кнопки Назад','Enter the path to an image you would like to use as the page next button.'=>'Введите путь к изображению, которое вы хотите использовать в качестве кнопки для следующей страницы.','Next Button Image'=>'Изображение кнопки Далее','Enter the text you would like to appear on the page next button.'=>'Введите текст, который вы бы хотели видеть на кнопке для следующей страницы.','Next Button Text'=>'Текст кнопки Далее','Name each of the pages on your form.  Page names are displayed with the selected progress indicator.'=>'Назовите каждую из страниц формы. Имена страниц отображаются на выбранном индикаторе выполнения.','Select which progress bar style you would like to use.  Select custom to choose your own text and background color.'=>'Выберите стиль для индикатора выполнения, который хотите использовать. Выберите произвольный, чтобы использовать собственный текст и цвет фона.','Select which type of visual progress indicator you would like to display.  Progress Bar, Steps or None.'=>'Выберите тип визуального представления индикатора выполнения, который хотите отображать. Шкала завершения, Шаги или никакого.','Create rules to dynamically display or hide this page based on values from another field.'=>'Создайте правила для динамического отображения или сокрытия этой страницы на основе значений из другого поля.','Page Conditional Logic'=>'Условная логика страницы','Enter a message to be displayed to users who are not logged in (shortcodes and HTML are supported).'=>'Введите сообщение, которое будет отображаться для пользователей, что не вошли в систему (поддерживается HTML и короткие коды).','Check this option to require a user to be logged in to view this form.'=>'Отметьте эту опцию, чтобы требовать от пользователя входа в систему для просмотра этой формы.','Check this option to add a text input as the final choice of your radio button field. This allows the user to specify a value that is not a predefined choice.'=>'Выберите эту опцию для добавления текстового поля в варианты ответа. Это позволит пользователю задать свое значение, которое не доступно при выборе.','"Other" Choice'=>'Вариант "Другое"','Check this option to add a "Select All" checkbox before the checkbox choices to allow users to check all the checkboxes with one click.'=>'Отметьте этот параметр, чтобы добавить флажок "Выбрать все" перед флажками выборов. Это позволит отмечать все флажки одним кликом.','"Select All" Choice'=>'Вариант "Выбрать все"','Text of the consent checkbox.'=>'Текст флажка соглашения.','Checkbox Text'=>'Текст флажка','By selecting this option, the %s jQuery script will be applied to this field, enabling search capabilities to Drop Down fields and a more user-friendly interface for Multi Select fields.'=>'Выбрав эту опцию, для этого поля будет использоваться скрипт jQuery %s,  позволяющий дать возможность поиска в выпадающем меню и с более удобным интерфейсом для выбора нескольких вариантов.','Enable Enhanced UI'=>'Включить расширенный интерфейс','Create rules to dynamically display or hide this field based on values from another field.'=>'Создайте правила для динамического отображения или сокрытия этого поля на основе значений из другого поля.','Check this option to specify a value for each choice. Choice values are not displayed to the user viewing the form, but are accessible to administrators when viewing the entry.'=>'Установите этот флажок, чтобы указать значение для каждого варианта. Выбор варианта не отображается для пользователя, просматривающего форму, но доступен администратору при просмотре записи.','Enable Choice Values'=>'Включить значения вариантов','Define the choices for this field. If the field type supports it you will also be able to select the default choice(s) using a radio or checkbox located to the left of the choice.'=>'Определите варианты для этого поля. Если тип поля поддерживает, то вы сможете выбрать вариант(ы) по умолчанию с помощью флажков и переключателей слева от варианта.','Field Choices'=>'Выбор вариантов','Enter the CSS class name you would like to use in order to override the default styles for this field.'=>'Введите имя класса CSS, которое бы вы хотели использовать для замещения стиля по умолчанию для этого поля.','Select the language you would like to use for the reCAPTCHA display from the available options.'=>'Выберите из доступных вариантов язык, который вы бы хотели использовать для отображения reCAPTCHA.','reCAPTCHA Language'=>'Язык reCAPTCHA','If you would like to override the default error validation for a field, enter it here.  This message will be displayed if there is an error with this field when the user submits the form.'=>'Если вы хотите переопределить стандартное сообщение при ошибке заполнении формы, то вы можете ввести его здесь. Это сообщение будет показано, если поле будет неправильно заполнено.','Validation Message'=>'Проверочное сообщение','Autocomplete Attribute'=>'Атрибут автозаполнения','Select this setting to display the option as activated by default when the form first loads.'=>'Выберите этот параметр, чтобы отобразить вариант, который активируется по умолчанию при отображении формы.','Activated by Default'=>'Активировано по умолчанию','Select the field to be used as the source for the values for this field.'=>'Выберите поле, которое будет использоваться в качестве источника для значений этого поля.','Enter the label to be displayed next to the check box. For example, &quot;same as shipping address&quot;.'=>'Введите текст, который будет отображен рядом с флажком. Например, &quot;такой же как и адрес доставки&quot;.','Activate this option to allow users to skip this field and submit the values entered in the associated field. For example, this is useful for shipping and billing address fields.'=>'Включите эту опцию, чтобы разрешить пользователям пропустить это поле и использовать значения, введенные в связанном поле. Например, это полезно для полей адресов доставки и выставления счетов.','Use Values Submitted in a Different Field'=>'Использовать значения переданные в другом поле','Placeholders will not be submitted along with the form. Use Placeholders to give a hint at the expected value or format.'=>'Заполнители не будут переданы вместе с данными формы. Используйте заполнители в качестве подсказки для желаемого значения или его формата.','The Placeholder will not be submitted along with the form. Use the Placeholder to give a hint at the expected value or format.'=>'Заполнитель не будет передан вместе с данными формы. Используйте заполнитель в качестве подсказки для желаемого значения или его формата.','If you would like to pre-populate the value of a field, enter it here.'=>'Если вы хотите, что бы какое то значение уже было вписано в поле, введите его здесь.','Select the fields you\'d like to use in this Address Field and customize the Sub-Labels by entering new ones.'=>'Выберите поля, которые хотите использовать для этого поля адреса и настройте подписи, добавив новые.','Add Choices to this field. You can mark a choice as selected by default by using the radio buttons on the left.'=>'Добавьте варианты в это поле. Вы можете пометить каждый вариант как вариант по умолчанию, с помощью переключателей слева.','Name Prefix Choices'=>'Варианты префикса имени','Select the fields you\'d like to use in this Name field and customize the Sub-Labels by entering new ones.'=>'Выберите поля, которые хотите использовать для этого поля имени и настройте подписи, добавив новые.','Select a form field size from the available options. This will set the width of the field. Please note: if using a paragraph field, the size applies only to the height of the field.'=>'Выберите размер поля из доступных вариантов. Это устанавливает ширину данного поля. Обратите внимание: для поля параграф размер выставляется только для высоты поля.','Select the sub-label placement.  Sub-labels can be placed above the field inputs or below the field inputs.'=>'Выберите размещение подписи. Подпись может быть размещена над или под полем ввода.','Select the description placement.  Descriptions can be placed above the field inputs or below the field inputs.'=>'Выберите размещение описания.  Описание может быть размещено над или под полем ввода.','Select the label visibility for this field.  Labels can either inherit the form setting or be hidden.'=>'Выберите область видимости названия для этого поля. Названия могут либо наследовать настройки формы, либо быть скрыты.','Label Visibility'=>'Видимость названия','Enter values in this setting to override the Sub-Label for each field.'=>'Введите значения этого параметра, чтобы переопределить подпись для каждого поля.','Enter the admin label of the form field.  Entering a value in this field will override the Field Label when displayed in the Gravity Forms administration tool.'=>'Введите администраторский заголовок поля. Введенный заголовок будет замещать обычный заголовок поля при показе в консоли Gravity Forms.','Admin Label'=>'Заголовок для администратора','Specify how many decimal places the number should be rounded to.'=>'Укажите количество знаков после запятой, до которого необходимо округлить число.','Specify a mathematical formula. The result of this formula will be dynamically populated as the value for this field.'=>'Укажите математическую формулу. Результат этой формулы динамически подставится как значение для этого поля.','Enabling calculations will allow the value of this field to be dynamically calculated based on a mathematical formula.'=>'Включение расчетов позволит рассчитывать значение этого поля динамически, исходя из математической формулы.','Enter the minimum and maximum values for this form field.  This will require that the value entered by the user must fall within this range.'=>'Введите минимальный и максимальный предел для значения этого поля формы. Это ограничит введенное пользователем значение этим диапазоном.','Number Range'=>'Числовой диапазон','Select this option to hide the field label in the form.'=>'Выберите этот параметр, чтобы спрятать заголовок поля на форме.','Hide Field Label'=>'Спрятать заголовок поля','Select this option to limit user input to unique values only.  This will require that a value entered in a field does not currently exist in the entry database for that field.'=>'Выберите эту опцию, что бы пользователь вводил только уникальные значения. Это потребует того, что бы введенные значения для данного поля не присутствовали в базе данных.','Select this option to make the form field required.  A required field will prevent the form from being submitted if it is not filled out or selected.'=>'Выберите эту опцию, если поле является обязательным для заполнения. Обязательное поле будет препятствовать отправке формы, если оно не заполнено.','Required Field'=>'Обязательное поле','Enter the description for the form field.  This will be displayed to the user and provide some direction on how the field should be filled out or selected.'=>'Введите описание для этого поля. Оно будет показано пользователю и будет служить некой подсказкой о том, как правильно заполнять это поле.','Field Description'=>'Описание поля','Select the format you would like to use for the phone input.  Available options are domestic US/CANADA style phone number and international long format phone number.'=>'Выберите формат, который вы бы хотели использовать для ввода телефона.  Имеющимися вариантами являются номера телефонов США/Канады и международные номера телефонов длинного формата.','Phone Number Format'=>'Формат телефонных номеров','Specify the maximum file size in megabytes allowed for each of the files.'=>'Укажите максимальный разрешенный размер файла в мегабайтах для каждого из файлов.','Specify the maximum number of files that can be uploaded using this field. Leave blank for unlimited. Note that the actual number of files permitted may be limited by this server\'s specifications and configuration.'=>'Укажите максимальное количество файлов, которое может быть загружено с помощью этого поля. Оставьте пустым для неограниченного количества. Обратите внимание, что фактическое количество разрешенных файлов может ограничиваться спецификацией сервера и его настройками.','Select this option to enable multiple files to be uploaded for this field.'=>'Выберите этот вариант, чтобы разрешить множественную загрузку файлов для этого поля.','Enter the allowed file extensions for file uploads.  This will limit the type of files a user may upload.'=>'Введите допустимые расширения файлов для загрузки. Это ограничит типы файлов, которые может загрузить пользователь.','Allowed File Extensions'=>'Разрешенные расширения файлов','Select the format you would like to use for the time field.  Available options are 12 hour (i.e. 8:30 pm) and 24 hour (i.e. 20:30).'=>'Выберите формат для ввода времени, который вы хотите использовать. Доступны варианты 12-часового формата (например, 8:30 д.п.) и 24-часового (например, 20:30).','Select the format you would like to use for the date input.'=>'Выберите формат для ввода дат, который вы хотите использовать.','Field Date Format'=>'Формат поля даты','Check this box to prevent this field from being displayed in a non-secure page (i.e. not https://). It will redirect the page to the same URL, but starting with https:// instead. This option requires a properly configured SSL certificate.'=>'Отметьте этот флажок, чтобы предотвратить отображение поля на небезопасной странице (без https://). Это перенаправит страницу на этот же адрес URL, но с указанием https:// протокола. Эта функция требует правильно настроенного сертификата SSL.','Select the format of numbers that are allowed in this field. You have the option to use a comma or a dot as the decimal separator.'=>'Выберите разрешенный формат чисел для этого поля. Как разделитель целой и дробной части вы можете использовать точку или запятую.','Select the format you would like to use for the Name field.  There are 3 options, Normal which includes First and Last Name, Extended which adds Prefix and Suffix, or Simple which is a single input field.'=>'Выберите формат, который вы хотите использовать в поле Имя. Доступны 3 варианта. Обычный содержит Имя и Фамилию, Расширенный дополняется Префиксом и Суффиксом, Простой имеет только одно поле ввода.','Field Name Format'=>'Формат имени','Check this box to prevent the State/Province/Region from being displayed in the form.'=>'Отметьте этот флажок, чтобы предотвратить отображение поля Штат/Провинция/Регион на форме.','Hide State/Province/Region'=>'Скрыть штат/провинцию/регион','Check this box to prevent Province field from being displayed in the form.'=>'Отметьте этот флажок, чтобы предотвратить отображение поля Провинция на форме.','Hide Province Field'=>'Скрыть провинцию','Check this box to prevent the State field from being displayed in the form.'=>'Отметьте этот флажок, чтобы предотвратить отображение поля Штат на форме.','Hide State Field'=>'Скрыть штат','Check this box to prevent the extra address input (Address Line 2) from being displayed in the form.'=>'Отметьте этот флажок, чтобы предотвратить отображение дополнительного поля ввода адреса (Адрес 2) на форме.','Hide Address Line 2'=>'Скрыть дополнительную адресную строку','For addresses that only apply to one country, you can choose to not display the country drop down. Entries will still be recorded with the selected country.'=>'Для адресов в пределах одной страны, можно не отображать выпадающий список со странами. Записи все же будут сохранены с выбранной страной.','Hide Country'=>'Скрыть страну','Select the country you would like to be selected by default when the form gets displayed.'=>'Выберите страну, которую следует выбрать по умолчанию при отображении формы.','Select the province you would like to be selected by default when the form gets displayed.'=>'Выберите провинцию, которую следует выбрать по умолчанию при отображении формы.','Default Province'=>'Провинция по умолчанию','Select the state you would like to be selected by default when the form gets displayed.'=>'Выберите штат, который следует выбрать по умолчанию при отображении формы.','Default State'=>'Штат по умолчанию','Select the type of address you would like to use.'=>'Выберите тип адреса, который хотите использовать.','Select the type of inputs you would like to use for the date field. Date Picker will let users select a date from a calendar. Date Field will let users free type the date.'=>'Выберите желаемый тип ввода для поля с датой. Окно выбора даты позволит пользователям выбирать дату из календаря. Поле ввода же позволит пользователям вводить дату с клавиатуры.','Enter the maximum number of rows that users are allowed to add.'=>'Введите максимальное количество строк, которое разрешено будет добавить пользователю.','Enter the maximum number of characters that this field is allowed to have.'=>'Введите максимальное количество символов, которое можно ввести в это поле.','Select the type of field from the available form fields.'=>'Выберите тип поля из доступных полей формы.','Field type'=>'Тип поля','Select the custom field name from available existing custom fields, or enter a new custom field name.'=>'Выберите имя произвольного поля из доступных существующих произвольных полей, или введите новое имя для произвольного поля.','Select the position of the badge containing the links to Google\'s privacy policy and terms.'=>'Выберите расположение бейджа со ссылками на политику и условия конфиденциальности Google.','CAPTCHA Badge Position'=>'Расположение бейджа CAPTCHA','Select the type of CAPTCHA you would like to use.'=>'Выберите тип CAPTCHA, которую хотите использовать.','CAPTCHA Type'=>'Тип CAPTCHA','Select the visual theme for the reCAPTCHA field from the available options to better match your site design.'=>'Выберите визуальное оформление поля reCAPTCHA из доступных вариантов, которое наиболее подходит к дизайну вашего сайта.','reCAPTCHA Theme'=>'Тема reCAPTCHA','When enabled, margins are added to properly align the HTML content with other form fields.'=>'Когда включено, поля добавляются для правильного выравнивания содержимого HTML с другими полями формы.','Disable Default Margins'=>'Отключить отступы по умолчанию','Enter the label for this HTML block. It will help you identify your HTML blocks in the form editor, but it will not be displayed on the form.'=>'Введите название для этого блока HTML. Название поможет идентифицировать блоки HTML в редакторе формы, но оно не будет отображаться на форме.','Enter the label of the form field.  This is the field title the user will see when filling out the form.'=>'Введите заголовок поля формы. Пользователь увидит этот заголовок возле поля при заполнении формы.','To pass field data to the confirmation page, build a Query String using the \'Insert Merge Tag\' drop down. %s..more info on querystrings &raquo;%s'=>'Чтобы передать данные поля на страницу подтверждения, создайте строку запроса с помощью выпадающего списка \'Вставить Метку Слияния\'. %s..детальная информация о строках запроса &raquo;%s','Pass Data Via Query String'=>'Передавать данные через строку запроса','Enter the URL of the webpage you would like the user to be redirected to after they have submitted the form.'=>'Введите URL, на который пользователь должен быть переправлен после отправки формы.','Redirect Form to URL'=>'Перенаправление формы на URL','Select the page you would like the user to be redirected to after they have submitted the form.'=>'Выберите страницу, на которую пользователь будет перенаправлен после отправки формы.','Redirect Form to Page'=>'Перенаправление формы на страницу','When enabled, auto-formatting will insert paragraph breaks automatically. Disable auto-formatting when using HTML to create the confirmation content.'=>'Когда включено, автоматическое форматирование будет вставлять разрывы абзацев автоматически. Отключите автоматическое форматирование при использовании HTML во время создания содержимого подтверждения.','Enter the text you would like the user to see on the confirmation page of this form.'=>'Введите текст, который пользователь должен видеть на странице подтверждения этой формы.','Confirmation Message Text'=>'Текст сообщения подтверждения','Enter the URL of a custom image to replace the default \'delete item\' icon. A maximum size of 16px by 16px is recommended'=>'Введите URL произвольного изображения, чтобы заменить стандартную иконку "удалить элемент". Рекомендуем максимальный размер 16x16 пикселей','Enter the URL of a custom image to replace the default \'add item\' icon. A maximum size of 16px by 16px is recommended'=>'Введите URL произвольного изображения, чтобы заменить стандартную иконку "добавить элемент". Рекомендуем максимальный размер 16x16 пикселей','Enter the CSS class name you would like to use in order to override the default styles for this form.'=>'Введите имя класса CSS, которое бы вы хотели использовать для замещения стиля по умолчанию этой формы.','Form CSS Class Name'=>'Имя класса CSS этой формы','Enter the path to an image you would like to use as the form submit button.'=>'Введите путь к изображению, которое вы хотите использовать в качестве кнопки для отправки формы.','Form Button Image'=>'Изображение кнопки формы','Enter the text you would like to appear on the form submit button.'=>'Введите текст, который вы бы хотели видеть на кнопке для отправки формы.','Form Button Text'=>'Текст на кнопке формы','Required Indicator'=>'Обязательный индикатор','Select the default sub-label placement.  Sub-labels can be placed above the field inputs or below the field inputs. This setting can be overridden in the appearance settings for each field.'=>'Выберите размещение подписи по умолчанию. Подписи могут располагаться сверху от поля ввода или снизу от поля ввода. Эти настройки могут быть изменены в настройках отображения для каждого поля.','Select the default description placement.  Descriptions can be placed above the field inputs or below the field inputs. This setting can be overridden in the appearance settings for each field.'=>'Выберите размещение описания по умолчанию. Описания могут располагаться сверху от поля ввода или снизу от поля ввода. Эти настройки могут быть изменены в настройках отображения для каждого поля.','Select the default label placement.  Labels can be top aligned above a field, left aligned to the left of a field, or right aligned to the right of a field. This is a global label placement setting.'=>'Выберите размещение метки по умолчанию. Метки могут быть выровнены сверху над полем, слева от поля или справа от поля. Это глобальная настройка размещения меток.','Form Label Placement'=>'Расположение названия формы','Enter a description for your form. This may be used for user instructions.'=>'Введите описание для вашей формы. Оно может использоваться как инструкция для пользователя.','Enter the title of your form.'=>'Введите заголовок вашей формы.','Check this option to enable Gravity Forms\' legacy markup. This will hinder the accessibility of your form.'=>'Отметьте этот параметр, чтобы включить старую разметку Gravity Forms. Это затруднит доступ к вашей форме.','Legacy Markup'=>'Старая разметка','Check this option to enable a sliding animation when displaying/hiding conditional logic fields.'=>'Установите этот флажок, чтобы включить слайдовую анимацию при отображении/скрытии полей условной логики.','Enable Animation'=>'Включить анимацию','Enables the honeypot spam protection technique, which is an alternative to the reCAPTCHA field.'=>'Включает антиспамовую технологию HoneySpot, которая является альтернативой reCAPTCHA.','Enable Anti-spam honeypot'=>'Включить антиспамовую приманку','Schedule a time period the form is active.'=>'Введите период времени, в течении которого эта форма будет активна.','Enter a number in the input box below to limit the number of entries allowed for this form. The form will become inactive when that number is reached.'=>'Введите количество записей, которое можно создать с помощью этой формы. Когда это число будет достигнуто, форма станет не активна.','Limit Number of Entries'=>'Ограничить число записей','Limit the number of entries a form can generate and/or schedule a time period the form is active.'=>'Установите лимит записей, которые может генерировать форма, и/или запланируйте временной отрезок активности формы.','Limit Form Activity'=>'Ограничить активность формы','When enabled, any files uploaded to File Upload fields will be attached to the notification email.'=>'Если включено, все файлы загруженные через поля загрузки будут приложены к письму уведомления.','Enter a comma separated list of email addresses you would like to receive a BCC of the notification email.'=>'Введите список адресов электронной почты, разделенный запятыми, на который следует высылать BCC письма с уведомлениями.','Blind Carbon Copy Addresses'=>'Адреса Blind Carbon Copy','Enter a comma separated list of email addresses you would like to receive a CC of the notification email.'=>'Введите список адресов электронной почты, разделенный запятыми, на который следует высылать CC письма с уведомлениями.','Carbon Copy Addresses'=>'Адреса Carbon Copy','Enter the email address you would like to be used as the reply to address for the notification email.'=>'Введите адрес электронной почты, на который следует отправлять ответы на письма с уведомлениями.','Enter the name you would like the notification email sent from, or select the name from available name fields.'=>'Введите имя, от лица которого следует высылать письма с уведомлениями, или выберите имя из доступных полей формы.','Enter an authorized email address you would like the notification email sent from. To avoid deliverability issues, always use your site domain in the from email.'=>'Введите адрес email, c которого следует высылать письма с уведомлениями. Всегда используйте домен вашего сайта во избежание проблем с доставкой.','From Email Address'=>'Email адрес отправителя','Allows notification to be sent to different email addresses depending on values selected in the form.'=>'Позволяет отсылать уведомления на разные адреса email, исходя из значений, выбранных в форме при отправке.','Routing'=>'Маршрут','When enabled, auto-formatting will insert paragraph breaks automatically. Disable auto-formatting when using HTML to create email notification content.'=>'Когда включено, автоматическое форматирование будет вставлять разрывы абзацев автоматически. Отключите автоматическое форматирование при использовании HTML для создания уведомлений по электронной почте.','Disable Auto-Formatting'=>'Отключить автоформатирование','Enter the email address you would like the notification email sent to.'=>'Введите адрес email, на который следует высылать письма с уведомлениями.','Send To Email Address'=>'Отправить на email','New submission from'=>'Новая запись от','User Login'=>'Логин пользователя','User Email'=>'Email пользователя','User Display Name'=>'Отображаемое имя пользователя','HTTP Referer URL'=>'HTTP Referer URL','HTTP User Agent'=>'HTTP User Agent','Embed Post/Page Title'=>'Заголовок связанной записи/страницы','Embed Post/Page Id'=>'Id связанной записи/страницы','User IP Address'=>'IP адрес пользователя','Insert Merge Tag'=>'Вставить метку слияния','Pricing Fields'=>'Расценочные поля','Post Fields'=>'Поля записей блога','View Form'=>'Просмотреть форму','Form Updated'=>'Форма обновлена','The form title you have entered is already taken. Please enter a unique form title.'=>'Введенный заголовок формы уже занят. Пожалуйста, введите уникальный заголовок формы.','Enable Next Button Conditional Logic'=>'Включить условную логику "Следующая кнопка"','Enable Page Conditional Logic'=>'Включить страничную условную логику','Enable Conditional Logic'=>'Использовать условную логику','Allow field to be populated dynamically'=>'Разрешить динамическое заполнение этого поля','Use the Rich Text Editor'=>'Использовать расширенный текстовый редактор','Visibility'=>'Видимость','Force SSL'=>'Принудительный SSL','Enable Password Input'=>'Включить ввод пароля','Delete Icon URL'=>'Удалить URL иконки','Add Icon URL'=>'Добавить URL иконки','Zulu'=>'Зулусский','Vietnamese'=>'Вьетнамский','Urdu'=>'Урду','Ukrainian'=>'Украинский','Turkish'=>'Турецкий','Thai'=>'Тайский','Telugu'=>'Телугу','Tamil'=>'Тамильский','Swedish'=>'Шведский','Swahili'=>'Суахили','Spanish (Latin America)'=>'Испанский (Латинская Америка)','Spanish'=>'Испанский','Slovenian'=>'Словенский','Slovak'=>'Словацкий','Sinhalese'=>'Сингальский','Serbian'=>'Сербский','Russian'=>'Русский','Romanian'=>'Румынский','Portuguese (Portugal)'=>'Португальский (Порту