d, in UTC.'=>'Время создания записи в UTC.','The date the entry was created, in UTC.'=>'Время создания записи в UTC.','The Form ID for the entry.'=>'ID формы для записи.','Unique identifier for the resource.'=>'Уникальный идентификатор ресурса.','Missing entry JSON'=>'Отсутствует JSON записи','The field values.'=>'Значения полей.','The input values.'=>'Входные значения.','Form not found.'=>'Форма не найдена.','The Form object must be sent as a JSON string in the request body with the content-type header set to application/json.'=>'Объект формы должен быть отправлен как строка JSON в теле запроса с заголовком content-type выставленным в application/json.','The form has already been deleted.'=>'Форма уже удалена.','Invalid form id.'=>'Неверный id формы.','The add-on the feed belongs to.'=>'Это дополнение нуждается в обновлении. Пожалуйста, свяжитесь с разработчиком.','The JSON string containing the feed meta.'=>'Отсутствует JSON записи','The Form ID for the feed.'=>'ID формы для записи.','Unique identifier for the feed.'=>'Уникальный идентификатор ресурса.','Missing feed meta'=>'Отсутствует JSON записи','Missing add-on slug'=>'Недостающий Id формы','Missing feed JSON'=>'Отсутствует JSON записи','Missing Key Value Pairs JSON'=>'Отсутствуют JSON пары ключ-значение','Entry updated successfully'=>'Запись успешно обновлена','Property values should be sent as an array'=>'Значения свойств следует передавать как массив','No property values were found in the request body'=>'В теле запроса не найдено значений свойств','You don\'t have any API keys. Let\'s go %1$screate one%2$s!'=>'У вас нет ни одного ключа API. Давайте %1$sсоздадим первый%2$s!','Never Accessed'=>'Еще без доступа','Last Access'=>'Последний доступ','Permissions'=>'Разрешения','User'=>'Пользователь','Create A Form'=>'Создать форму','Installation Complete'=>'Установка завершена','Congratulations! Click the \'Create A Form\' button to get started.'=>'Поздравляем! Нажмите на кнопку "Создать форму", чтобы приступить к работе.','Global Settings'=>'Глобальные настройки','Protect your form entries from spam using Akismet.'=>'Защитите ваши записи от спама с помощью Akismet.','Akismet Integration'=>'Интеграция Akismet','Set this to ON to display the Forms menu in the WordPress top toolbar. The Forms menu will display the latest ten forms recently opened in the form editor.'=>'Включите для отображения меню Формы в верхней панели инструментов WordPress. Меню Формы отображает десять последних форм, что были открыты в редакторе форм.','Toolbar Menu'=>'Меню панели инструментов','Set this to ON to prevent extraneous scripts and styles from being printed on Gravity Forms admin pages, reducing conflicts with other plugins and themes.'=>'Включите для предотвращения загрузки лишних скриптов и стилей на страницах администрирования Gravity Forms, чтобы уменьшить конфликты с другими плагинами и темами.','Off'=>'Откл','On'=>'Вкл','Select a Currency'=>'Выберите валюту','Back'=>'Назад','Next'=>'Следующая','Please accept the terms'=>'Пожалуйста, примите условия.','Invalid or Expired Key : Please make sure you have entered the correct value and that your key is not expired.'=>'Неверный или истекший ключ: Пожалуйста, убедитесь, что вы ввели правильное значение и, что действие вашего ключ не истекло.','Please enter a valid license key.'=>'Пожалуйста, введите действующий лицензионный ключ.','License Key'=>'Лицензионный ключ','I understand the risks of not providing a valid license key.'=>'Я понимаю риск отсутствия актуального лицензионного ключа.','If you don\'t enter a valid license key, you will not be able to update Gravity Forms when important bug fixes and security enhancements are released. This can be a serious security risk for your site.'=>'Если вы не введете действующий лицензионный ключ, у вас не будет возможности обновлять Gravity Forms, включая релизы с важными исправлениями и усовершенствованиями. Это может нести серьезную угрозу безопасности для вашего сайта.','Enter your Gravity Forms License Key below.  Your key unlocks access to automatic updates, the add-on installer, and support.  You can find your key on the My Account page on the %sGravity Forms%s site.'=>'Введите ваш лицензионный ключ от Gravity Forms ниже. Ваш ключ открывает доступ к автоматическому обновлению, установщику дополнений и технической поддержке. Вы можете найти ключ на странице вашей учетной записи сайта %sGravity Forms%s.','Disabled'=>'Отключено','Please accept the terms.'=>'Пожалуйста, примите условия.','Background Updates'=>'Фоновые обновления','I understand and accept the risk of not enabling background updates.'=>'Я понимаю и принимаю риск отключения фоновых обновлений.','By disabling background updates your site may not get critical bug fixes and security enhancements. We only recommend doing this if you are experienced at managing a WordPress site and accept the risks involved in manually keeping your WordPress site updated.'=>'Если отключить фоновые обновления, ваш сайт может не получить критических исправлений ошибок и улучшений безопасности. Мы рекомендуем делать так, только если у вас есть опыт в управлении сайтами WordPress и вы принимаете риски, связанные с поддержанием вашего сайта в актуальном состоянии.','Are you sure?'=>'Вы уверены?','Turn off background updates'=>'Отключить фоновые обновления','Keep background updates enabled'=>'Оставить включенными фоновые обновления','Updates will only be available if you have entered a valid License Key'=>'Обновления будут доступны только для действующего лицензионного ключа','This feature is activated by default unless you opt to disable it below. We only recommend disabling background updates if you intend on managing updates manually.'=>'Эта функция активирована по умолчанию, только если вы не отключили ее ниже. Мы рекомендуем отключать фоновые обновления лишь в том случае, если вы собираетесь управлять обновлениями вручную.','Gravity Forms will download important bug fixes, security enhancements and plugin updates automatically. Updates are extremely important to the security of your WordPress site.'=>'Gravity Forms  автоматически загрузит важные исправления, усовершенствования системы безопасности и обновления плагинов. Обновления крайне важны для безопасности вашего WordPress сайта.','Welcome to Gravity Forms'=>'Добро пожаловать в Gravity Forms','There was a problem while inserting the field values'=>'Возникла проблема при вставке значений поля','There was a problem while inserting one of the input values for the entry'=>'Возникла проблема при вставке одного из входящих значений для записи','An error prevented the entry for this form submission being saved. Please contact support.'=>'Ошибка, предотвратившая отправку данных для этой формы, сохранена. Обратитесь в службу поддержки.','You don\'t have adequate permission to edit entries.'=>'У вас нет достаточных прав для редактирования записей.','Every %d Minutes'=>'Каждые %d минут','Inactive'=>'Неактивные','Active'=>'Активные','feeds'=>'ленты','feed'=>'лента','Checkbox'=>'Флажок','Select which actions should only occur after payment has been received.'=>'Выберите действия, которые необходимо выполнить после получения платежа.','Post Payment Actions'=>'Действия после оплаты','Process %s feed only when payment is received.'=>'Обработать ленту %s только при получении платежа.','Invalid value'=>'Неверное значение','To get started, please configure your %s.'=>'Для начала, пожалуйста, настройте %s.','You don\'t have any feeds configured. Let\'s go %screate one%s!'=>'У вас нет ни одной настроенной ленты. Давайте %sсоздадим первую%s!','\'Cancel\' to stop, \'OK\' to delete.'=>'\'Отмена\' для отмены, \'OK\' для удаления.','WARNING: You are about to delete this item.'=>'ВНИМАНИЕ: Вы хотите удалить этот элемент.','Duplicate'=>'Дублировать','Edit'=>'Редактировать','Delete'=>'Удалить','There was an error updating this feed. Please review all errors below and try again.'=>'Возникла ошибка при обновлении ленты. Пожалуйста, просмотрите ошибки ниже и попробуйте заново.','Feed updated successfully.'=>'Лента успешно обновлена.','You don\'t have sufficient permissions to update the form settings.'=>'У вас отсутствуют необходимые права для обновления настроек формы.','Feed Settings'=>'Настройка ленты','Unable to render feed settings.'=>'Невозможно отобразить настройки ленты.','%s Feeds'=>'Ленты %s','Add New'=>'Добавить','Copy %d'=>'Копия %d','Copy 1'=>'Копия 1','You don\'t have adequate permission to uninstall this add-on: '=>'У вас недостаточно прав для удаления этого дополнения:','Warning! ALL %s settings will be deleted. This cannot be undone. \'OK\' to delete, \'Cancel\' to stop'=>'Внимание! ВСЕ настройки %s будут удалены. Это необратимо. \'OK\' — удалить, \'Отмена\' — отменить','%sThis operation deletes ALL %s settings%s. If you continue, you will NOT be able to retrieve these settings.'=>'%sЭта операция удалит ВСЕ настройки %s%s. Если вы продолжите, вы НЕ сможете восстановить эти настройки.','Uninstall Add-On'=>'Удалить дополнение','Uninstall %s Add-On'=>'Деинсталлировать дополнение %s','You don\'t have sufficient permissions to update the settings.'=>'У вас отсутствуют необходимые права для обновления настроек.','Warning'=>'Предупреждение','Uninstall %s'=>'Деинсталлировать %s','%s has been successfully uninstalled. It can be re-activated from the %splugins page%s.'=>'%s успешно деинсталлировано. Плагин может быть повторно активирован на %sстранице плагинов%s.','This add-on needs to be updated. Please contact the developer.'=>'Это дополнение нуждается в обновлении. Пожалуйста, свяжитесь с разработчиком.','You don\'t have adequate permission to view this page'=>'У вас нет необходимых прав для просмотр этой страницы','Unable to render form settings.'=>'Невозможно отобразить настройки формы.','Validation Error'=>'Ошибка проверки','Add Custom Key'=>'Добавить произвольный ключ','Please add a %s field to your form.'=>'Пожалуйста, добавьте поле %s к вашей форме.','%s settings updated.'=>'Настройки %s обновлены.','Field type \'%s\' has not been implemented'=>'Тип поля \'%s\' не был реализован','Field could not be rendered.'=>'Поле не может быть отображено.','%s Settings'=>'Настройки %s','Gravity Forms Add-Ons'=>'Дополнения Gravity Forms','Results Page'=>'Страница результатов','Add-On Settings'=>'Настройки дополнения','Add-On Page'=>'Страница дополнения','Uninstall'=>'Деинсталляция','GF Add-Ons'=>'Дополнения Gravity Forms','Please resolve the following issues to use %s:'=>'Пожалуйста, устраните следующие неполадки для использования  %s:','%s is not able to run because your WordPress environment has not met the minimum requirements.'=>'Невозможно запустить %s из-за несоответствия вашей установки WordPress минимальным требованиям.','Current WordPress version (%s) does not meet minimum WordPress version requirement (%s).'=>'Текущая версия WordPress (%s) не соответствует минимальным требованиям (%s).','Required PHP function missing: %s'=>'Отсутствует необходимая функция PHP: %s.','Required PHP extension "%s" does not meet minimum version requirement: %s.'=>'Необходимое расширение PHP "%s" не соответствует минимальным требованиям: %s.','Required PHP extension missing: %s'=>'Отсутствует необходимое расширение PHP: %s.','Current PHP version (%s) does not meet minimum PHP version requirement (%s).'=>'Текущая версия PHP (%s) не соответствует минимальным требованиям (%s).','Required WordPress plugin is missing: %s.'=>'Отсутствует необходимый плагин WordPress: %s.','Required Gravity Forms Add-On "%s" does not meet minimum version requirement: %s.'=>'Необходимое дополнение Gravity Forms "%s" не соответствует минимальным требованиям по версии: %s.','Required Gravity Forms Add-On is missing: %s.'=>'Отсутствует необходимое дополнение Gravity Forms: %s.','Show more'=>'Показать еще','Latest values:'=>'Последние значения:','Item'=>'Элемент','Average score'=>'Средняя оценка','Average global score'=>'Средняя глобальная оценка','Frequency'=>'Частота','Choice'=>'Вариант','No entries for this field'=>'Нет записей для этого поля','No results'=>'Нет результатов','Entries processed: %1$d of %2$d'=>'Обработано записей: %1$d of %2$d','There was an error while processing the entries. Please contact support.'=>'Произошла ошибка во время обработки записей. Обратитесь в службу поддержки.','No results.'=>'Нет результатов.','The average (mean) score: The sum of the scores divided by the number of entries.'=>'Средняя оценка: сумма баллов, поделенная на количество записей.','Average Score'=>'Средняя оценка','The average (mean) score for the whole field. The sum of the total scores divided by the number of entries.'=>'Средняя оценка для всего поля. Сумма общих баллов, поделенная на количество записей.','Average Global Score'=>'Средняя глобальная оценка','The average (mean) score for each row: the sum of all the scores for each row divided by the total number of entries.'=>'Средняя оценка для каждого ряда: сумма всех баллов для каждого яда, разделенная на общее количество записей.','Average Row Score'=>'Средняя оценка ряда','Narrow the results by adding filters. Note that some field types support more options than others.'=>'Сужайте результаты путем добавления фильтров. Обратите внимание, что некоторые типы полей поддерживают больше параметров, чем другие.','Date Range is optional, if no date range is specified it will be ignored.'=>'Временной диапазон необязателен. Если не указан временной промежуток, он будет игнорироваться.','The aggregate rank is the overall rank for all entries based on the weighted scores for each item.'=>'Совокупный ранг — это общий ранг для всех записей на основе взвешенных баллов для каждого элемента.','Aggregate Rank'=>'Совокупный ранг','Scores are weighted calculations. Items ranked higher are given a greater score than items that are ranked lower. The total score for each item is the sum of the weighted scores.'=>'Оценки являются взвешенными расчетами. Элементы с более высоким рейтингом дают больший балл, чем элементы, с более низким рейтингом. Общ